import React from 'react';

const About = () => {
  return (
    <div className="p-8" style={{ backgroundColor: '#040244', color: 'white' }}>
      <h1 className="text-3xl font-bold mb-4">About Us</h1>
      <p>
        Welcome to Space Hub. Our mission is to bring people together to meet, create, and celebrate.
        We provide an online marketplace that makes it easier than ever to find and book unique spaces
        for any activity.
      </p>
    </div>
  );
};

export default About;
